create table stock_log
(
    id         int(11) unsigned auto_increment
        primary key,
    goods_id   int          null comment '商品ID',
    goods_name varchar(100) null comment '商品名称',
    goods_spec varchar(50)  null comment '商品规格',
    order_sn   varchar(30)  null comment '订单编号',
    store_id   int          null comment '商家ID',
    muid       int          null comment '操作用户ID',
    stock      int          null comment '更改库存',
    ctime      int          null comment '操作时间'
)
    charset = utf8;

